(7, 'trxGradingPencentage', 'Fitur menentukan %/JJg setiap PKS', NULL, 'Json', NULL, '{\"trxGradingBMPERSEN\":0, \"trxGradingBLMPERSEN\":0, \"trxGradingTPPERSEN\":0, \"trxGradingTKPERSEN\":0, \"trxGradingPartenoPERSEN\":0, \"trxGradingBrondolanPERSEN\":0, \"trxGradingSAMPAHPERSEN\":0, \"trxGradingAIRPERSEN\":0}', NULL, NULL, NULL, NULL, '2023-10-17 01:56:30.221'),
(8, 'hitungPotBuahMentah', 'Fitur menentukan rumus untuk potongan Buah Mentah', NULL, 'Function', NULL, 'trxGradingBMPERSENValidate(\n            trxGradingBMPERSEN: number,\n            qtyTbs: number,\n            adTransactionMILL_ID: string,\n            originWeighInKg: number,\n            originWeighOutKg: number,\n          ): number {\n            let persenbm: number;\n            let trxGradingBMKG: number = 0;\n            const weightnetto = originWeighInKg - originWeighOutKg;\n            if (trxGradingBMPERSEN !== null) {\n              if (qtyTbs === 0 || qtyTbs === null) {\n                // Display an error message (you can handle this as needed)\n                console.error(\'Jumlah janjang 0 atau tidak ada.\');\n                persenbm = 0;\n              } else {\n                persenbm = trxGradingBMPERSEN / qtyTbs;\n              }\n          \n              if (adTransactionMILL_ID === \'BA41\') {\n                trxGradingBMKG = Math.round((persenbm * weightnetto) / 100);\n              }\n          \n              if (adTransactionMILL_ID === \'BN41\') {\n                trxGradingBMKG = Math.round(persenbm * weightnetto * 0.5);\n              }\n            }\n          \n            // Return the relevant value based on your logic\n            // For example, you might want to return trxGradingBMKG or trxGradingBMKG\n            return trxGradingBMKG; // or return trxGradingBMKG;\n          }', NULL, NULL, NULL, NULL, '2023-10-17 01:56:30.221'),
(9, 'hitungPotBuahLewatMatang', 'Fitur menentukan rumus untuk potongan Buah lewat Matang', NULL, 'Function', NULL, 'trxGradingBLMPERSENValidate(\n            trxGradingBLMPERSEN: number,\n            qtyTbs: number,\n            adTransactionMILL_ID: string,\n            originWeighInKg: number,\n            originWeighOutKg: number,\n            persentasiTangkaiPanjang: number,\n          ): number {\n            let persemblm: number = 0;\n            const weightnetto = originWeighInKg - originWeighOutKg;\n            if (trxGradingBLMPERSEN !== null) {\n              if (qtyTbs === 0 || qtyTbs === null) {\n                // Display an error message (you can handle this as needed)\n                console.error(\'Jumlah janjang 0 atau tidak ada.\');\n              } else {\n                persemblm = trxGradingBLMPERSEN / qtyTbs;\n          \n                if (adTransactionMILL_ID === \'BA41\') {\n                  return Math.round((persemblm * weightnetto) / 100);\n                }\n          \n                if (adTransactionMILL_ID === \'BN41\') {\n                  persemblm *= 100;\n          \n                  if (persemblm >= 5) {\n                    return Math.round(((25 / 100) * (persemblm - 5) * weightnetto) / 100);\n                  } else {\n                    return 0;\n                  }\n                }\n              }\n            }\n          \n            // Return 0 if none of the conditions are met\n            return 0;\n          }', NULL, NULL, NULL, NULL, '2023-10-17 01:56:30.221'),
(10, 'potonganTangkaiPanjang', 'Fitur menentukan rumus untuk potongan Tangkai Panjang', NULL, 'Function', NULL, 'trxGradingTPPERSENValidate(\n            trxGradingTPPesen: number,\n            qtyTbs: number,\n            adTransactionMILL_ID: string,\n            originWeighInKg: number,\n            originWeighOutKg: number,\n          ): number {\n            let persentp: number = 0;\n            const weightnetto = originWeighInKg - originWeighOutKg;\n            if (trxGradingTPPesen !== null) {\n              if (qtyTbs === 0 || qtyTbs === null) {\n                // Display an error message (you can handle this as needed)\n                console.error(\'Jumlah janjang 0 atau tidak ada.\');\n              } else {\n                persentp = (trxGradingTPPesen / qtyTbs) * 100;\n          \n                if (adTransactionMILL_ID === \'BA41\') {\n                  return Math.round((persentp * weightnetto) / 100);\n                }\n          \n                if (adTransactionMILL_ID === \'BN41\') {\n                  return Math.round((persentp * (1 / 100) * weightnetto) / 100);\n                }\n              }\n            }\n          \n            // Return 0 if none of the conditions are met\n            return 0;\n          }\n          ', NULL, NULL, NULL, NULL, '2023-10-17 01:56:30.221'),
(11, 'potonganTandanKosong', 'Fitur menentukan rumus untuk potongan Tandan Kosong', NULL, 'Function', NULL, '', NULL, NULL, NULL, NULL, '2023-10-17 01:56:30.221'),
(12, 'potonganSampah', 'Fitur menentukan rumus untuk potongan Sampah', NULL, 'Function', NULL, 'trxGradingSAMPAHPERSENValidate(\n            trxGradingSAMPAHPERSEN: number,\n            originWeighInKg: number,\n            originWeighOutKg: number,\n            adTransactionMILLID: string,\n          ): number {\n            let trxGradingSAMPAHKG = 0;\n            const weightnetto = originWeighInKg - originWeighOutKg;\n            if (trxGradingSAMPAHPERSEN !== null) {\n              trxGradingSAMPAHKG = Math.round(\n                (trxGradingSAMPAHPERSEN / weightnetto) * 100,\n              );\n            }\n          \n            if (adTransactionMILLID === \'BA4l\' || adTransactionMILLID === \'BN41\') {\n              trxGradingSAMPAHKG = 2 * trxGradingSAMPAHPERSEN;\n            }\n          \n            return trxGradingSAMPAHKG;\n          }', NULL, NULL, NULL, '7f20c889-43c1-4831-a454-64b9400a75fb', '2023-10-17 08:04:56.051'),
(13, 'hitungPotonganAir', 'Fitur menentukan rumus untuk potongan Air', NULL, 'Function', NULL, 'weightnetto: number<##FunctionCode##>  if (trxGradingPERSEN !== null) {\n    return Math.round((trxGradingPERSEN * weightnetto) / 100);\n  }\n  return 0; // Return 0 if trxGradingPERSEN is null', NULL, NULL, NULL, '7f20c889-43c1-4831-a454-64b9400a75fb', '2023-10-20 22:45:31.954'),
