(16, 'potonganLainnya', 'Fitur menentukan rumus untuk potongan Lainnya', NULL, 'Function', NULL, 'trxGradingLAINNYAPERSENValidate(\n            trxGradingLAINNYAPERSEN: number,\n            originWeighInKg: number,\n            originWeighOutKg: number,\n            adTransactionMILL_ID: string,\n          ): number {\n            const weightnetto = originWeighInKg - originWeighOutKg;\n            if (trxGradingLAINNYAPERSEN !== null) {\n              let trxGradingLATNNYAKG = Math.round(\n                (trxGradingLAINNYAPERSEN * weightnetto) / 100,\n              );\n          \n              if (adTransactionMILL_ID === \'AN41\') {\n                trxGradingLATNNYAKG = Math.round(\n                  (trxGradingLAINNYAPERSEN / 100) * weightnetto,\n                );\n              }\n          \n              return trxGradingLATNNYAKG;\n            }\n          \n            // Return 0 if trxGradingLAINNYAPERSEN is null\n            return 0;\n          }\n          ', NULL, NULL, NULL, NULL, '2023-10-17 01:56:30.221'),
(17, 'potonganWajib', 'Fitur menentukan rumus untuk potongan Wajib', NULL, 'Function', NULL, 'weightnetto: number,trxGradingPERSEN: number<##FunctionCode##>if (trxGradingPERSEN !== null) {\n  let trxGradingWAJIBKG = Math.round((trxGradingPERSEN * weightnetto) / 100);\n\n  if (adTransactionMILL_ID === \'AN41\') {\n    trxGradingWAJIBKG = Math.round((trxGradingPERSEN / 100) * weightnetto);\n  }\n\n  return trxGradingWAJIBKG;\n}\n\nreturn 0; // Return 0 if trxGradingWAJIB is null', NULL, NULL, NULL, '7f20c889-43c1-4831-a454-64b9400a75fb', '2023-10-20 23:00:22.316'),
